import React from 'react'
import StoryCell from '../components/StoryCell'

export default ({ stories, toggleLike, showClickStoryContent }) => {
  return (
    <div className='Stories' >
      {
        stories.map(story =>
          <StoryCell
            key={story.id}
            story={story}
            toggleLike={toggleLike}
            onClick={(e) => showStoryContent(e)}
          />
        )
      }
    </div>
  )
}
